import React, { useState } from "react";
import AddUsers from "./Components/Users/AddUsers";
import UserList from "./Components/Users/UserList";
const App = ()=>{
    const [userlist , setUserList] = useState([])
    return(
        <>
            <AddUsers/>
            <UserList users={userlist}/>
        </>
    )
}
export default App;
